function I = fcnK0M(S, T, u, alpha, F, tol)
t1 = 0.1e1 ./ alpha;t2 = -alpha + u;t3 = 0.1e1 ./ t2;t4 = t3 .* t1;t5 = sqrt(-alpha);t6 = F - t5;t7 = 0.1e1 ./ t6;t8 = t6 .^ 2;t9 = t6 .* t5;t12 = sqrt(t8 + 0.2e1 .* t9 - alpha + u);t13 = 0.1e1 ./ t12;t17 = t5 .* t1;t18 = t2 .^ 2;t19 = 0.1e1 ./ t18;t23 = F .* t19;t24 = 0.1e1 ./ u;t28 = sqrt(t2);t30 = 0.1e1 ./ t28 ./ t18;t34 = log(0.2e1 .* t7 .* (t12 .* t28 - alpha + t9 + u));t38 = t24 .* F;t42 = F + t5;t43 = 0.1e1 ./ t42;t44 = t42 .^ 2;t45 = t42 .* t5;t48 = sqrt(t44 - 0.2e1 .* t45 - alpha + u);t49 = 0.1e1 ./ t48;t62 = log(0.2e1 .* t43 .* (t48 .* t28 - alpha - t45 + u));t70 = 0.1e1 ./ t5 .* t1;t75 = 0.1e1 ./ t28 ./ t2;t85 = t13 .* t7 .* t4 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t13 .* t19 .* t17 + 0.3e1 ./ 0.4e1 .* t13 .* t24 .* t23 - 0.3e1 ./ 0.4e1 .* t34 .* t30 .* t17 + t13 .* t38 .* t4 ./ 0.4e1 + t49 .* t43 .* t4 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t49 .* t19 .* t17 + 0.3e1 ./ 0.4e1 .* t49 .* t24 .* t23 + 0.3e1 ./ 0.4e1 .* t62 .* t30 .* t17 + t49 .* t38 .* t4 ./ 0.4e1 + t13 .* t3 .* t70 ./ 0.4e1 - t34 .* t75 .* t70 ./ 0.4e1 - t49 .* t3 .* t70 ./ 0.4e1 + t62 .* t75 .* t70 ./ 0.4e1;
I = t85(:,:,2) - t85(:,:,1);

end
